import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import { createTheme } from "@mui/material";

const maintheme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1b5e20',
    },
    secondary: {
      main: '#fbc02d',
    },
    error: {
      main: '#b71c1c',
    },
  },
  typography: {
    fontFamily: 'Oswald',
  },
})


ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App theme={maintheme}/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
